const TaskList = ({task, remove}) => {
  // Map through the tasks
  const taskNode = tasks.map((task) => {
    return (<Task todo={task} key={task.id} remove={remove}/>)
  });
  return (<ul>{taskNode}</ul>);
}

export default TaskList;
